import React from 'react'
// import { Button } from 'antd';
import { Layout } from 'antd';
import './index.css'

const App = () => {

  const { Header, Footer, Sider, Content } = Layout;

  return (
    <>
    <Layout>
      <Sider>Sider</Sider>
      <Layout>
        <Header>Header</Header>
        <Content>Content</Content>
        <Footer>Footer</Footer>
      </Layout>
    </Layout>
    </>
  )
}

export default App
